import './Evaluaciones.css';

function Evaluaciones(props) {
    return (
      <div>
        <div className="Contenido">
          {props.codigo}
        </div>
        <div className="Descripcion">
          {props.descripcion}
        </div>
        <div className="Pie">
          {props.fechaLimite}
        </div>
      </div>
    );
  }
  
export default Publicación;
